  [],\n\t\"num_tags\": 3,\n\t\"name\": \"impact-actuated-digging-tool-for-lunar-excavation-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Honeybee Robotics proposes to develop a
  vacuum compatible, impact-actuated digging tool for the excavation of frozen and
  compacted regolith on the lunar surface and in the permanently shadowed craters
  of the lunar poles.  This technology development effort will address the most challenging
  aspects of excavation in the lunar environment and work to develop a design relevant
  to a range of future lunar missions.  This effort will also serve to guide and inform
  the requirements for the vehicles and systems that will be necessary for such missions.
  The fundamental architecture of an impact-actuated digging tool has been demonstrated
  for terrestrial applications for the Department of Defense.  Honeybee's digging
  tool design is a novel approach ideally suited for lunar applications to defeat
  compacted and frozen regolith.  By using the impact energy imparted by a reciprocating
  hammer transferred through the scoop to defeat the target material, the need for
  large reaction loads from the vehicle is minimized, allowing for a much smaller,
  lower mass system. This ongoing effort will serve to instruct and maximize the benefit
  to NASA.\",\n\t\"owner_org\": \"d8a6202b-c0c3-463d-88a0-3bc021a178ed\",\n\t\"extras\":
